export const addTodo = (data) => {
  return {
    type: "ADD_TODO",
    payload: {
      id: new Date().getTime().toString(),
      data: data,
    },
  };
};

export const deleteTodo = (id) => {
  return {
    type: "DELETE_TODO",
    id,
  };
};

export const removeAllTodo = () => {
  return {
    type: "REMOVE_ALL_TODO",
  };
};

export const editTODO = (id) => {
  return {
    type: "EDIT_TODO",
    id,
  };
};
